      {}
    ]

    this.state = {rows: [
      <p key="1"> This is my row</p>,
      <p key="2"> This is my row</p>,
      <p key="3"> This is my row</p>
    ]}

    var movieRows = [];

    movies.forEach((movie) => {
      console.log(movie.title)
    })
  }

  render() {
    return (
      <div className="App">
        <table className="titleBar">
          <tbody>
            <tr>
              <td>
                <img alt="app icon" width="100" src="image2vector.svg"/>
              </td>
              <td width="15"/>
              <td>
                <h1>Movies DB Search</h1>
              </td>
            </tr>
          </tbody>
        </table>

        <input style={{
          fontSize: 24,
          display: 'block',
          width: "99%",
          paddingTop: 8,
          paddingBottom: 8,
          paddingLeft: 50,
        }} placeholder="Enter search term"/>  

        {this.state.rows}



      </div>
    );
  }
}

export default App;
